import React from "react";
import PropTypes from "prop-types";
import { Provider } from "react-redux";
import { ConnectedRouter } from "connected-react-router";
import "../assets/styles/layouts.scss";
import "../assets/styles/user-styles.css";
import BaseRouting from "./BaseRouting";
import {Helmet} from "react-helmet";
import {KEYCLOAK_URL} from "../constants/constants";
import "../assets/fonts/BCSans-Bold.woff"
import "../assets/fonts/BCSans-BoldItalic.woff";
import "../assets/fonts/BCSans-Italic.woff";
import "../assets/fonts/BCSans-Regular.woff";

const App = React.memo((props) => {
    const { store, history } = props;
    return (
      <div>
        <Helmet>
          {KEYCLOAK_URL?<link rel="preconnect" href={KEYCLOAK_URL} />:null}
        </Helmet>
        <Provider store={store}>
          <ConnectedRouter history={history}>
            <BaseRouting store={store}/>
          </ConnectedRouter>
        </Provider>
      </div>
    );
});

App.propTypes = {
  history: PropTypes.any.isRequired,
  store: PropTypes.any.isRequired,
};

export default App;
